s":{},"id":"26371","type":"DataRange1d"},{"attributes":{},"id":"26390","type":"HelpTool"},{"attributes":{"args":{"highlighted_point_opacity":{"id":"26470"},"point_opacity":{"id":"26469"},"source":{"id":"26299"}},"code":"console.log('call apply_style')\nconst data = source.data;\nconst SIDs = data['SID'];\nconst highlight = data['highlight'];\nconst alpha = data['alpha'];\nconst x = data['x'];\nconst y = data['y'];\nconst figure_ids = data['figure_id'];\nconst sample_ids = data['sample_id'];\nconst compositions = data['composition'];\nconst elements = data['elements'];\n\nconst length = data['highlight'].length\n\nfor (let i = 0; i &lt; length; i++) {\n    if (!!highlight[i]) {\n        console.log(highlight[i])\n        alpha[i] = highlighted_point_opacity.value\n    } else {\n        alpha[i] = point_opacity.value\n    }\n}\nsource.change.emit();\n"},"id":"26482","type":"CustomJS"},{"attributes":{},"id":"26527","type":"BasicTickFormatter"},{"attributes":{"axis":{"id":"26311"},"coordinates":null,"group":null,"ticker":null},"id":"26314","type":"Grid"},{"attributes":{},"id":"26534","type":"AllLabels"},{"attributes":{"children":[{"id":"26500"},{"id":"26488"}]},"id":"26502","type":"Column"},{"attributes":{"children":[{"id":"26469"},{"id":"26470"}]},"id":"26500","type":"Row"},{"attributes":{"axis_label":"Temperature (K)","coordinates":null,"formatter":{"id":"26527"},"group":null,"major_label_policy":{"id":"26528"},"ticker":{"id":"26378"}},"id":"26377","type":"LinearAxis"},{"attributes":{},"id":"26345","type":"BasicTicker"},{"attributes":{},"id":"26531","type":"AllLabels"},{"attributes":{"tools":[{"id":"26385"},{"id":"26386"},{"id":"26387"},{"id":"26388"},{"id":"26389"},{"id":"26390"},{"id":"26458"},{"id":"26483"}]},"id":"26392","type":"Toolbar"},{"attributes":{},"id":"26319","type":"PanTool"},{"attributes":{},"id":"26375","type":"LogScale"},{"attributes":{},"id":"26415","type":"BasicTicker"},{"attributes":{"axis":{"id":"26414"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"26417","type":"Grid"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"highlight","transform":{"id":"26432"}},"hatch_alpha":{"value":0.1},"hatch_color":{"field":"highlight","transform":{"id":"26432"}},"line_alpha":{"value":0.1},"line_color":{"field":"highlight","transform":{"id":"26432"}},"x":{"field":"x"},"y":{"field":"y"}},"id":"26435","type":"Scatter"},{"attributes":{"coordinates":null,"group":null,"text":"log vs. linear scale"},"id":"26400","type":"Title"},{"attributes":{},"id":"26388","type":"SaveTool"},{"attributes":{},"id":"26349","type":"BasicTicker"},{"attributes":{"axis":{"id":"26348"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"26351","type":"Grid"},{"attributes":{"inline":true,"js_property_callbacks":{"change:active":[{"id":"26478"}]},"labels":["Raw composition"]},"id":"26473","type":"CheckboxGroup"},{"attributes":{},"id":"26402","type":"DataRange1d"},{"attributes":{},"id":"26536","type":"Selection"},{"attributes":{"fill_alpha":{"field":"alpha"},"fill_color":{"field":"highlight","transform":{"id":"26432"}},"hatch_alpha":{"field":"alpha"},"hatch_color":{"field":"highlight","transform":{"id":"26432"}},"line_alpha":{"field":"alpha"},"line_color":{"field":"highlight","transform":{"id":"26432"}},"x":{"field":"x"},"y":{"field":"y"}},"id":"26434","type":"Scatter"},{"attributes":{"axis":{"id":"26410"},"coordinates":null,"group":null,"ticker":null},"id":"26413","type":"Grid"},{"attributes":{"text":"&lt;h3&gt;Text format on tooltip&lt;/h3&gt;\n&lt;p&gt;In the tooltip, values separated by \"/\" represent:&lt;/p&gt;\n&lt;p&gt;SID (Starrydata ID), Figure ID, Sample ID, Sample composition&lt;/p&gt;\n&lt;p&gt;For example, \"1/2/3/NaCl\" corresponds to:&lt;/p&gt;\n&lt;p&gt;SID: 1, Figure ID: 2, Sample ID: 3, Sample composition: NaCl&lt;/p&gt;","width":800},"id":"26457","type":"Div"},{"attributes":{"args":{"checkbox_composition":{"id":"26473"},"checkbox_formula":{"id":"26474"},"checkbox_ids":{"id":"26472"},"h matched_compositions = [];\nconst unmatched_formulas = [];\nconst unmatched_elements = [];\n\nfunction pushMatchedData(i) {\n    matched_x.push(x[i]);\n    matched_y.push(y[i]);\n    matched_SID.push(SIDs[i]);\n    matched_highlight.push(1);\n    matched_alpha.push(highlighted_point_opacity.value);\n    matched_figure_id.push(figure_ids[i]);\n    matched_sample_id.push(sample_ids[i]);\n    matched_compositions.push(compositions[i]);\n    matched_formulas.push(formulas[i]);\n    matched_elements.push(elements[i]);\n}\n\nfunction pushUnmatchedData(i) {\n    unmatched_x.push(x[i]);\n    unmatched_y.push(y[i]);\n    unmatched_SID.push(SIDs[i]);\n    unmatched_highlight.push(0);\n    unmatched_alpha.push(point_opacity.value);\n    unmatched_figure_id.push(figure_ids[i]);\n    unmatched_sample_id.push(sample_ids[i]);\n    unmatched_compositions.push(compositions[i]);\n    unmatched_formulas.push(formulas[i]);\n    unmatched_elements.push(elements[i]);\n}\n\nconst sidFlag = checkbox_ids.active.includes(0) ? 1 : 0;\nconst figureFlag = checkbox_ids.active.includes(1) ? 1 : 0;\nconst sampleFlag = checkbox_ids.active.includes(2) ? 1 : 0;\nconst compositionFlag = checkbox_composition.active.length === 1 ? 1 : 0 &amp;&amp; composition.length &gt; 0\nconst formulaFlag = checkbox_formula.active.length === 1 ? 1 : 0 &amp;&amp; input_formula.value.length &gt; 0\nconst elementsPartialMatchFlag = radio_button_elements.active === 0 ? 1 : 0;\nconst elementsPerfectMatchFlag = radio_button_elements.active === 1 ? 1 : 0;\n\nconst combination = sidFlag * 32 + figureFlag * 16 + sampleFlag * 8 + compositionFlag * 4 + elementsPartialMatchFlag * 2 + elementsPerfectMatchFlag * 1;\nconst length = SIDs.length;\n\n// TODO: implement formula search\nfor (var i = 0; i &lt; length; i++) {\n    var isMatched = false;\n    switch (combination) {\n        case 56: // \"111000\" \u306e\u5834\u5408\n            isMatched = sid === SIDs[i] &amp;&amp; figure_id === figure_ids[i] &amp;&amp; sample_id === samp
